import React from 'react';
import Layout from '../Layout/Layout';
import './home.css';

function Home() {
  return (
    <div>
      <Layout>
        <div className='main_div'>
          <img
            className='home_bg'
            src={require(`../Assets/Images/bg.jpg`)}
            alt='avatar image'
          />
          <q>help others in the way of self-learning </q>
        </div>
      </Layout>
    </div>
  );
}

export default Home;
